pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract ChristmasChad is ERC721URIStorage, Ownable {

    struct NFT {
        string uri;
        uint256 tokenNumber;
        address ownerAddress;
        uint256 level;
    }
    
    uint8[] public registeredNFTS;

    mapping(uint256 => NFT) nfts;
    mapping(address => NFT[]) nftList;
    mapping(uint256 => uint256) nftListids;

    uint8 nextId = 0;

    constructor () ERC721("Christmas Chad", "CMC") {

    }

    fallback() external payable {
        payable(0x454C2CC415c4C395aea24594416943Ede7b4B420).transfer(msg.value / 4); // transfer my address 1 fourth of the payment revenue
    }

    function makeURL(string memory a, uint8 b, string memory c) internal returns (string memory finalString) {
        return string(abi.encodePacked(a, b, c));
    }

    function getOwnedNFTS(address addr) public view returns (NFT[] memory) {
        NFT[] memory list = nftList[addr];

        return list;
    }

    function getRegisteredNFTS() public view returns (uint8[] memory registered){
        return registeredNFTS;
    }

    function mint(address _to, string memory _uri) external {
        _safeMint(_to, nextId);
        _setTokenURI(nextId, _uri);

        registeredNFTS.push(nextId);

        NFT memory nft = NFT(_uri, nextId, _to, 0);

        nftList[_to].push(nft);

        nfts[nextId] = nft;

        nextId ++;
    }

    function dailyReward() public payable {
        uint128 levels = 0;

        for (uint i = 0; i<nextId; i++) {

        }

        _mint(msg.sender, levels);
    }

    function getNextId() public view returns (uint8 nextid) {
        return nextId;
    }


    function transfer(address from, address to, uint256 tokenId) external {
        _transfer(from, to, tokenId);
        NFT memory nft = nfts[tokenId];

        nft.ownerAddress = to;

        delete nftList[from][nftListids[tokenId]];        
        nftList[to].push(nft);
        nfts[tokenId] = nft;
    }
}
